import React from 'react'
import {ShoppingBag, SquareCode} from 'lucide-react';
const Product_mgmt_system = () => {
  return (
    <div className="bg-white shadow-2xl shadow-white-500/50 mt-3 ml-3 mr-3 text-black rounded-sm">
    <span className='flex mt-3 ml-3'><ShoppingBag className='mr-3 mt-1' size={15}/>Product Management System</span>
    <span className='font-normal flex ml-10 mr-10 text-justify'>In this project, the Admin can perform CRUD operations on products and the customer can Login/Register and Order/Add to Cart products.
    </span>
    <span className='text-justify flex ml-10 mr-10'>Technology: HTML5, CSS3, Javascript, Java, SQL</span>
    </div>
  )
}

export default Product_mgmt_system
